import React from 'react';

const Contact = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >

      <div class="ef3-back-to-top on"><i class="lnr lnr-arrow-up">::before=</i></div>
    </div>
  );
};

export default Contact;
